import { useSelector } from "react-redux"
import { INDEX_UTENTE } from "../utility/Route";
import { useHistory } from "react-router-dom";
import { useState } from "react";


export default function ListaTransazioniUtente({ setErrore }) {



    const utente = useSelector(state => state.utente);
    const [listaTransazioni, setListaTransazioni] = useState();
    const conto = useSelector(state => state.conto);
    const history = useHistory()

    function datiConto(conto) {
        if (!conto) {
            return <p>Non hai un conto</p>;
        } else {
            return (
                <>
                    <p style={{ marginBottom: 0 }}>
                        <b>Numero conto:</b> {conto.numeroConto}
                    </p>
                    <p style={{ marginBottom: 0 }}>
                        <b>Stato conto:</b> {(conto.stato) ? <>{conto.stato.statoContoCorrente}</> : <></>}
                    </p>
                    <p style={{ marginBottom: -10 }}>
                        <b>Saldo:</b> € {conto.saldo}
                    </p>
                </>
            );
        }


    }


    return (

        <>

            <div className="div">

                <div className="div-container">
                    <h3><b>Benvenuto {utente.nome} {utente.cognome}</b> </h3>
                    <h6><b>Ruolo: {(utente.ruolo) ? <>{utente.ruolo.tipoRuolo} </> : <></>}</b> </h6>
                    <p><b>{datiConto(conto)}</b></p>
                </div>
            </div>

            <div className="div-h1">
                <h3 style={{ color: "white" }}><b>LISTA TRANSAZIONI</b></h3>
            </div>
            <div className="table-wrapper">

                <table>
                    <thead>
                        <tr>
                            <th>TIPO TRANSAZIONE</th>
                            <th>DATA TRANSAZIONE</th>
                            <th>IMPORTO TRANSAZIONE</th>
                            <th>STATO TRANSAZIONE</th>
                        </tr>
                    </thead>
                    <tbody>

                        {listaTransazioni ? (
                            <>
                                {listaTransazioni.map((transazione) => {
                                    if (transazione.statoTransazione.id !== 3) {
                                        return (
                                            <tr key={transazione.id}>
                                                <td>{transazione.conto.utente.nome}</td>
                                                <td>{transazione.conto.utente.cognome}</td>
                                                <td>{transazione.conto.utente.codiceFiscale}</td>
                                                <td>{transazione.conto.numeroConto}</td>
                                                <td>€ {transazione.conto.saldo}</td>
                                                <td>{transazione.conto.stato.statoContoCorrente}</td>
                                                <td>{transazione.tipo.tipoTransazione}</td>
                                                <td>{transazione.dataTransazione}</td>
                                                <td>€ {transazione.importo}</td>
                                                <td>{transazione.statoTransazione.statoTransazione}</td>
                                            </tr>
                                        );
                                    } else {
                                        return null;
                                    }
                                })}
                            </>
                        ) : (
                            <>
                            </>
                        )}

                    </tbody>
                </table>
                <button className="button-1" style={{ marginTop: 10, height: 40 }} type="button" onClick={(e) => history.push(INDEX_UTENTE)} >Vai al menu</button>
            </div>





        </>
    )






}
